import React, { Component } from "react";
import { CentersTable } from "./centersTable";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const Centers = () => {
  return (
    <>
      <ToastContainer />
      <CentersTable />
    </>
  );
};

export default Centers;
